import React from 'react';
import Card from './Card.js';

class CardList extends React.Component {
    render() {
        console.log("cardlist", this.state);
        const items = this.props;
        return (
            <div className="row">
            {items.map(site => <Card{...site}/>)}
            </div>
        )
    }
}

export default CardList;
